def count_nucleobses(gene):
    count_A = 0
    count_T = 0
    count_G = 0
    count_C = 0
    
    for c in gene:
        if c == 'A':
            count_A += 1
        elif c == 'T':
            count_T += 1
        elif c == 'G':
            count_G += 1
        elif c == 'C':
            count_C += 1
    
    return(count_A, count_T, count_G, count_C)

gene = ''
a, t, g, c = count_nucleobses(gene)
print('A = ' + str(a))
print('T = ' + str(t))
print('G = ' + str(g))
print('C = ' + str(c))
